import React from 'react'
import './index.css'
import logo from '../../assets/images/logo.png'
import { Link } from 'react-router-dom'

function Login(){
    return (
        <div id="page-login-content"  >

            <form onSubmit={(event) => {
                    //event.preventDefault();
                    //alert('Video Cadastrado com Sucesso');


                }}>

                <img src={logo} alt="Logo" className="logo"/>

                <h3>Email:</h3>
                <input id="email" type="email" className="input"/>
                <h5 id="erro-email">Invalid email format</h5>
                <h3>Senha:</h3>
                <input id="senha" type="password" className="input"/>
                <h5 id="erro-senha">Password must contain more than 8 characters</h5>
                <br/>
                <Link id="button-login" to="/users">
                    Login
                </Link>
            </form>
        </div>
    )
}

export default Login;
